def countVersions():
    hids = open('./uniqueAllHids.txt', 'r').read().splitlines()
    print(len(hids))
    table = [0]*1000
    i = 0
    for hid in hids[100000:101000]:
        query = mongo.Queue.objects(hid=hid)
        versions = len(query)
        table[versions] += 1
        print(i)
        i+=1

    print(table)
    outF = open('versionCount.txt', 'w')
    for e in table:
        outF.write(e)
        outF.write('\n')

